// src/CustomerTable.js
import React, { useEffect, useState, useMemo } from 'react';
import axios from 'axios';
import { useTable, usePagination, useSortBy, useGlobalFilter } from 'react-table';
import './CustomerTable.css';

const CustomerTable = () => {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [pageCount, setPageCount] = useState(0);
  const [pageSize, setPageSize] = useState(20); // Number of records per page

  const fetchData = async (pageIndex, pageSize) => {
    try {
      setLoading(true);
      const result = await axios.get(`http://localhost:3000/customers?page=${pageIndex + 1}&limit=${pageSize}`);
      console.log('API Response:', result.data); // Log the API response
      if (Array.isArray(result.data.data)) {
        setData(result.data.data);
        setPageCount(Math.ceil(result.data.totalRecords / pageSize));
      } else {
        throw new Error('Data format is incorrect, expected an array in data field');
      }
    } catch (error) {
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchData(0, pageSize); // Load the first page on initial render
  }, [pageSize]);

  const columns = useMemo(
    () => [
      { Header: 'Serial No', accessor: 'sno' },
      { Header: 'Customer Name', accessor: 'customer_name' },
      { Header: 'Age', accessor: 'age' },
      { Header: 'Phone', accessor: 'phone' },
      { Header: 'Customer Location', accessor: 'customer_location' },
      { Header: 'Created At', accessor: 'created_at' }
    ],
    []
  );

  const {
    getTableProps,
    getTableBodyProps,
    headerGroups,
    prepareRow,
    page,
    canNextPage,
    canPreviousPage,
    state,
    setGlobalFilter,
    nextPage,
    previousPage,
    setPageIndex
  } = useTable(
    {
      columns,
      data,
      manualPagination: true, // Tell the usePagination hook that we'll handle our own pagination
      pageCount
    },
    useGlobalFilter,
    useSortBy,
    usePagination
  );

  const { globalFilter, pageIndex } = state;

  useEffect(() => {
    fetchData(pageIndex, pageSize); // Fetch data whenever pageIndex changes
  }, [pageIndex, pageSize]);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <>
      <input
        value={globalFilter || ''}
        onChange={(e) => setGlobalFilter(e.target.value || undefined)}
        placeholder="Search..."
      />
      <table {...getTableProps()}>
        <thead>
          {headerGroups.map(headerGroup => (
            <tr {...headerGroup.getHeaderGroupProps()}>
              {headerGroup.headers.map(column => (
                <th {...column.getHeaderProps(column.getSortByToggleProps())}>
                  {column.render('Header')}
                  <span>
                    {column.isSorted
                      ? column.isSortedDesc
                        ? ' ðŸ”½'
                        : ' ðŸ”¼'
                      : ''}
                  </span>
                </th>
              ))}
            </tr>
          ))}
        </thead>
        <tbody {...getTableBodyProps()}>
          {page.map(row => {
            prepareRow(row);
            return (
              <tr {...row.getRowProps()}>
                {row.cells.map(cell => {
                  return <td {...cell.getCellProps()}>{cell.render('Cell')}</td>;
                })}
              </tr>
            );
          })}
        </tbody>
      </table>
      <div>
        <button
          onClick={() => {
            previousPage();
            setPageIndex(old => Math.max(old - 1, 0));
          }}
          disabled={!canPreviousPage}
        >
          Previous
        </button>
        <span>
          Page{' '}
          <strong>
            {pageIndex + 1} of {pageOptions.length}
          </strong>
        </span>
        <button
          onClick={() => {
            nextPage();
            setPageIndex(old => old + 1);
          }}
          disabled={!canNextPage}
        >
          Next
        </button>
      </div>
    </>
  );
};

export default CustomerTable;
